s:9:"owner_pic";s:0:"";}i:234;a:1:{s:2:"id";s:19:"2391124599739915265";}i:235;a:1:{s:10:"short_code";s:11:"CEu-yedMhwB";}i:236;a:1:{s:12:"created_time";i:1599264286;}i:237;a:1:{s:7:"caption";s:1958:"Completamente cercado pelos fiordes, o antigo cais de Bryggen conserva suas casas de madeira coloridas datadas do antigo império mercantil hanseático.

As construções que outrora abrigavam estaleiros e recebiam mercadorias vindas de toda região Báltica, hoje dá lugar a cafés, museus, lojas de souvenir e restaurantes. 

Numa destas construções está o Bryggen Tracteursted, restaurante com conceito moderno, datado de 1708 e inspirado na cultura gastronômica de Bergen.

O local permite uma experiência completa, colocando a mesa uma boa refeição atrelada a uma vista espetacular. Os pratos são imersos nas especialidades locais, com uma variedade de peixes distribuídos em petiscos e tapas norueguesas. 

Para acompanhar o momento vale a prova da antiga cerveja Hansa Bryggeri, considerada patrimônio nórdico e estabelecida desde 1891 na cidade de Bergen com seu nome refletindo a história comercial da cidade. 

Nos meses mais quentes o ambiente no Tracteursted fica mais agradável, com o restaurante deixando as mesas ao ar livre no pátio ao fundo do estabelecimento e algumas mesas externas em Bryggestredet, uma importante via da cidade.

Para imergir nas demais atrações, próximo ao restaurante fica o museu hanseático, situado em uma casa customizada com decoração da época, onde é possível conferir toda passagem histórica de Bergen.

Seguindo por não mais que cinco minutos está o Fish Market, um notável mercado de peixes, local este que retrata toda tradição pesqueira dos noruegueses e motivo de orgulho local. 

No verão, outro grande destaque é o desfile da banda com componentes da marinha norueguesa, que elegantemente trajados e munidos dos instrumentos, saem da fortaleza tocando e assim seguem  por todo o trajeto em direção ao monumento na praça central da cidade.
 
